import React from 'react';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import './Music.css';

function Music({

    webImg, vid1, vid2

}) {
    return (
        <div className="music-container">
            <div className="web-img-wrapper">
                <img src={webImg} className="web-img"/>
            </div>
            <div className="music-text-wrapper">
                <h1>
                    Music
                </h1>
                <h2>
                    I like to make songs.
                </h2>
                <h3>
                    view my artist website @javimusiq.com
                </h3>
            </div>

            <div className="vid-wrapper">
                <video src={vid1} className="performance-1"/>
                <video src={vid2} className="performance-2"/>
            </div>
            

        </div>
    )
}

export default Music;
